import { Doughnut } from 'react-chartjs-2'
import styled from 'styled-components'


const data = {
  datasets: [{
    data: [4.89, 12.00]
  }]
}

const DoughnutChart = props => (
  <Graph>
    <Doughnut 
      data={ data }
      width={ 150 }
      height={ 150 }
      options={
        {cutoutPercentage: '75'},
        {}
      }
    />
  </Graph>
)

export default DoughnutChart    


const Graph = styled.div`
  width: 15rem;
  height: 15rem;
  border-radius: 100%
`
